import React, { useEffect, useRef } from 'react';
import { Col, Row } from 'react-bootstrap';
import { connect } from 'react-redux';

const PageCallToUs = () => {



    const emailRef : any = useRef<HTMLHeadingElement>(null);;


    useEffect(() => {
        console.log(emailRef.current);
        
    },[])

    const regExp = new RegExp( "/\A[^@]+@([^@\.]+\.)+[^@\.]+\z/")

    const str = "/\A[^@]+@([^@\.]+\.)+[^@\.]+\z/"

    const acceptEmail = () => {
        console.log(typeof emailRef.current.value);
        
        console.log(emailRef.current.value.match(str));
        
    }


    return (
        <>
            <Row>
                <Col lg={{ offset: 1, span: 10 }}>
                    <div className={'PageCallToUs-body'}>
                        <div className="PageCallToUs-content">
                            <div className={'tbl'}>
                                <Row>
                                    <Col lg={{ offset: 2, span: 3 }} className={'nonPading'}>
                                        <div className="PageCallToUs-inscriptionOurNumber-container" >
                                            <div className="PageCallToUs-inscriptionOurNumber-text">Our number: </div>
                                        </div>
                                    </Col>
                                    <Col lg={{ offset: 0, span: 5 }} className={'nonPading'}>
                                        <div className="PageCallToUs-number-text">228 228 228 228 228</div>

                                    </Col>
                                </Row>
                                <Row>
                                    <Col className={'nonPading-pageCallToUs-OurEmail'}>
                                        <div className={'PageCallToUs-OurEmail-container'}>
                                            <input className={'PageCallToUs-OurEmail-container-input'} type="text" placeholder="enter your Email" ref={emailRef}/>
                                            <div className={'PageCallToUs-OurEmail-container-button'} onClick={() => acceptEmail()}>kek</div>
                                        </div>
                                    </Col>
                                </Row>
                            </div>
                        </div>
                    </div>
                </Col>
            </Row>
        </>
    );
};

export default connect(null, null)(PageCallToUs);
